import ReactDom from "react-dom/client";
impo

const root = ReactDom.createRoot(document.getElementById("root"))

function MovieCards({ photo, category, name, duration }) {
    return (
        <div className="card">
            <img src="" className="poster" />
            <h3>{name}</h3>
            <h4>category: {category}</h4>
        </div>
    )
}
root.render(<>
   <MovieCards/>
</>


)
